// SPDX-License-Identifier: GPL-3.0

import "../service/ServiceContract.sol";
pragma solidity >=0.7.0 <0.9.0;

// 接口层智能合约，用于调用逻辑层



contract InterfactContract is ServiceContract{

    function interfaceJoin() public {
        join(msg.sender);
    }

    function interfaceGetAccountByAddress(address _userAdderss) public view returns(address) {

        return getAccountByAddress(_userAdderss);
    }

}
